package tippler

import (
	"encoding/json"
	"github.com/kellydunn/golang-geo"
)

func LoadAreas() {
	var areas []struct {
		Name string      `json:"name"`
		Loc  [][]float64 `json:"poly"`
	}
	err := json.Unmarshal([]byte(AREAS_JSON), &areas)
	if err != nil {
		return
	}
	Areas = make([]GeoLocation, len(areas))
	for i, area := range areas {
		points := make([]*geo.Point, len(area.Loc))
		for j, pt := range area.Loc {
			point := geo.NewPoint(pt[0], pt[1])
			points[j] = point
		}
		poly := geo.NewPolygon(points)
		Areas[i] = GeoLocation{Name: area.Name, polygon: poly}
	}
}

type GeoLocation struct {
	Name    string
	polygon *geo.Polygon
}

var Areas []GeoLocation

func FindClosestArea(point *geo.Point) *GeoLocation {
	for _, area := range Areas {
		if area.polygon.Contains(point) {
			return &area
		}
	}
	return nil
}

